def main(s, t):
    freq = {}
    for i in range(len(s)):
        freq[s[i]] = freq.get(s[i], 0) + 1
        freq[t[i]] = freq.get(t[i], 0) - 1
    freq[t[-1]] = freq.get(t[-1], 0) - 1
    print(freq)
    for element in freq:
        if freq[element]:
            return element
    return ""


if __name__ == '__main__':
    _s = ""
    _t = ""
    main(_s, _t)
